import React, { useState, useEffect } from 'react';
import { Container, Typography, Grid, Card, CardContent, Box, CircularProgress } from '@mui/material';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import MediaOverview from '../components/MediaOverview';
import NewspaperIcon from '@mui/icons-material/Newspaper';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import GroupIcon from '@mui/icons-material/Group';

const StatCard = ({ icon, title, value, delay }) => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  return (
    <motion.div
      ref={ref}
      initial={{ opacity: 0, y: 50 }}
      animate={inView ? { opacity: 1, y: 0 } : { opacity: 0, y: 50 }}
      transition={{ duration: 0.5, delay }}
    >
      <Card 
        elevation={3}
        sx={{
          height: '100%',
          background: 'linear-gradient(45deg, #1976d2 30%, #21CBF3 90%)',
          color: 'white'
        }}
      >
        <CardContent>
          <Box display="flex" alignItems="center" mb={2}>
            {icon}
            <Typography variant="h6" ml={1}>
              {title}
            </Typography>
          </Box>
          <Typography variant="h4" component="div">
            {value}
          </Typography>
        </CardContent>
      </Card>
    </motion.div>
  );
};

const Dashboard = () => {
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simuleret data - erstat med faktisk API kald
    setTimeout(() => {
      setStats({
        totalArticles: "12,453",
        activeUsers: "2,891",
        dailyAnalyses: "342"
      });
      setLoading(false);
    }, 1000);
  }, []);

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="80vh">
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Container maxWidth="lg" sx={{ mt: 8, mb: 8 }}>
      <motion.div
        initial={{ opacity: 0, y: -50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <Typography 
          variant="h3" 
          gutterBottom 
          align="center"
          sx={{ 
            mb: 6,
            fontWeight: 'bold',
            background: 'linear-gradient(45deg, #1976d2 30%, #21CBF3 90%)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent'
          }}
        >
          Mediekompasset
        </Typography>
      </motion.div>

      <Grid container spacing={4} sx={{ mb: 6 }}>
        <Grid item xs={12} md={4}>
          <StatCard 
            icon={<NewspaperIcon sx={{ fontSize: 40 }} />}
            title="Analyserede artikler"
            value={stats.totalArticles}
            delay={0.2}
          />
        </Grid>
        <Grid item xs={12} md={4}>
          <StatCard 
            icon={<TrendingUpIcon sx={{ fontSize: 40 }} />}
            title="Daglige analyser"
            value={stats.dailyAnalyses}
            delay={0.4}
          />
        </Grid>
        <Grid item xs={12} md={4}>
          <StatCard 
            icon={<GroupIcon sx={{ fontSize: 40 }} />}
            title="Aktive brugere"
            value={stats.activeUsers}
            delay={0.6}
          />
        </Grid>
      </Grid>

      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5, delay: 0.8 }}
      >
        <Card elevation={3}>
          <CardContent>
            <Typography variant="h5" gutterBottom>
              Medieoversigt
            </Typography>
            <MediaOverview />
          </CardContent>
        </Card>
      </motion.div>
    </Container>
  );
};

export default Dashboard;
